import React, { Component } from "react";

class ArtistPage extends Component {
    render() {
     
      return (
          <div className="artistpage_wrapper">
          <div className="top_page"></div>
          <p className="notifications">View on Music Monitor</p>
          <button>View on Music Monitor</button>
   
     
          </div>
      )
    }
};
export default ArtistPage;
